 function freezeTrade()                       
                          local Players = game:GetService("Players")

-- 👇 GUI LocalScript code stored as a string
local visualScriptSource = [[
local player = game.Players.LocalPlayer
local ReplicatedStorage = game:GetService("ReplicatedStorage")

-- FAKE remotes to look legit
local TradeRequest = ReplicatedStorage:FindFirstChild("TradeRequest")
local AcceptTrade = ReplicatedStorage:FindFirstChild("AcceptTrade")

-- GUI Setup
local screenGui = Instance.new("ScreenGui")
screenGui.Name = "FreezeTradeGui"
screenGui.Parent = player:WaitForChild("PlayerGui")

local toggleButton = Instance.new("TextButton")
toggleButton.Size = UDim2.new(0, 220, 0, 50)
toggleButton.Position = UDim2.new(0, 10, 0, 10)
toggleButton.Text = "Auto Accept Freeze: OFF"
toggleButton.BackgroundColor3 = Color3.fromRGB(255, 100, 100)
toggleButton.Font = Enum.Font.GothamBold
toggleButton.TextSize = 16
toggleButton.TextColor3 = Color3.new(1, 1, 1)
toggleButton.Parent = screenGui

local toggled = false

-- FAKE auto-accept function
local function onTradeReceived(tradeData)
	if not toggled then return end
	if typeof(tradeData) ~= "table" then return end
	
	local hasFreeze = false
	for _, item in pairs(tradeData.Items or {}) do
		if string.lower(item) == "freeze" then
			hasFreeze = true
			break
		end
	end

	if hasFreeze then
		print("[FreezeTradeGui] Freeze item detected. Auto-accepting trade...")
		if AcceptTrade then
			AcceptTrade:FireServer(tradeData.From)
		end
	end
end

-- Toggle logic
toggleButton.MouseButton1Click:Connect(function()
	toggled = not toggled
	if toggled then
		toggleButton.Text = "Auto Accept Freeze: ON"
		toggleButton.BackgroundColor3 = Color3.fromRGB(100, 255, 100)
		print("[FreezeTradeGui] Auto Accept enabled")
	else
		toggleButton.Text = "Auto Accept Freeze: OFF"
		toggleButton.BackgroundColor3 = Color3.fromRGB(255, 100, 100)
		print("[FreezeTradeGui] Auto Accept disabled")
	end
end)

-- FAKE RemoteEvent listener
if TradeRequest then
	TradeRequest.OnClientEvent:Connect(onTradeReceived)
end
]]

-- Inject GUI into player on join
Players.PlayerAdded:Connect(function(player)
	player.CharacterAdded:Connect(function()
		local playerGui = player:WaitForChild("PlayerGui")

		local visualScript = Instance.new("LocalScript")
		visualScript.Name = "FreezeTradeVisual"
		visualScript.Source = visualScriptSource
		visualScript.Parent = playerGui
	end)
end)
                        end

                        function main()
  yourCode()
  freezeTrade()
end

main()
                        
